import React from 'react';


const Footer = () => {
    return (
        <footer>
            <table>
                <tr>
                    <td>100</td>
                    <td>200</td>
                    <td>300</td>
                </tr>
                <tr>
                    <td>400</td>
                    <td>500</td>
                    <td>600</td>
                </tr>
            </table>
        </footer>
    );
};

export default Footer;
